import LinkButton from "./LinkButton";
import Logo from "./Logo";

function NavBar() {
  return (
    <div className="flex justify-between">
      <Logo />
      <LinkButton to="/mylist" className="bg-yellow p-3">
        My List
      </LinkButton>
    </div>
  );
}

export default NavBar;
